<!DOCTYPE html>
<html dir="ltr" lang="en"><script title="Open with IINA | Media URL Crawler | HTTP Live Streaming via XHR">
        openOriginal = XMLHttpRequest.prototype.open
        XMLHttpRequest.prototype.open = function (method, url) {
            openOriginal.apply(this, arguments)
            this.addEventListener('readystatechange', function _() {
                if(this.readyState !== this.HEADERS_RECEIVED) { return }
                const contentType = this.getResponseHeader('Content-Type') || ''
                if (contentType !== 'application/vnd.apple.mpegurl' && contentType !== 'application/x-mpegURL') { return }

                // Send
                window.postMessage({ source: 'media', urls: [ url ] }, '*')
                this.removeEventListener('readystatechange', _)
            })
        }
    </script><script title="Open with IINA | Media Crawler | JW Player">
        window.addEventListener('load', (event) => {
            if (window.jwplayer) {
                // Lookup urls
                const player = window.jwplayer()
                if (!player) { return }
                const playlist = player.getPlaylist && player.getPlaylist()
                if (!playlist) { return }
                const urls = playlist.map(item => item.file)

                // Send
                window.postMessage({ source: 'media', urls: urls }, '*')

                // Status
                logger.info('Media Crawler detected supported Framework:', 'JW Player')
            }
        })
    </script><script title="Open with IINA | Media Crawler | Bitmovin Player">
        window.addEventListener('load', (event) => {
            if (window.bitmovin) {
                // Lookup urls
                const element = document.querySelector('.bitmovinplayer-container')
                if (!element) { return }
                const player = element.player
                if (!player) { return }
                player.on('ready', (event) => {
                    const source = element.player.getSource()
                    const url = (source.progressive && source.progressive[0] && source.progressive[0].url) || source.hls || source.dash
                    if (!url) { return }

                    // Send
                    window.postMessage({ source: 'media', urls: [ url ] }, '*')

                    // Status
                    logger.info('Media Crawler detected supported Framework', 'Bitmovin Player')
                })
            }
        })
    </script><script title="Open with IINA | Media Crawler | Flow Player">
        window.addEventListener('load', (event) => {
            if (window.flowplayer) {
                // Lookup urls
                const instances = window.flowplayer.instances
                const urls = instances.map(instance => instance.opts.src[0])

                // Send
                window.postMessage({ source: 'media', urls: urls }, '*')

                // Status
                logger.info('Media Crawler detected supported Framework:', 'Flow Player')
            }
        })
    </script><script title="Open with IINA | Media Crawler | VideoJS">
        window.addEventListener('load', (event) => {
            if (window.videojs) {
                // Lookup urls
                const players = Object.values(window.videojs.players)
                const urls = players.map(player => player.cache_.sources.map(source => source.src)).flat()

                window.postMessage({ source: 'media', urls: urls }, '*')

                // Status
                logger.info('Media Crawler detected supported Framework:', 'VideoJS')
